/* Procedure structure for procedure `despesa_parcelada` */

/*!50003 DROP PROCEDURE IF EXISTS  `despesa_parcelada` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `despesa_parcelada`()
BEGIN
	set @id_lancamentopai = 1142;
    set @id_centrodecusto = 3;
    set @id_finalidade = 157;
    set @id_formadepagamento = 5;
    set @valor = 69.90;
    SET @numeroParcelas = 12;
	SET @numeroParcelaAtual = 2;
    set @datadoacontecimento = '2017-01-01';
    set @localdadespesa = 'Palmas-TO. Yamaha.';
    set @descricao = 'PAGSEGUROUOL*PagSeguro';
    set @descricaodetalhada = 'Compra da maquineta';    
	set @data = '2017-08-10'; -- Essa data será a que será utilizada nas demais parcelas.
    

	WHILE @numeroParcelaAtual <= @numeroParcelas DO
		set @data = DATE_ADD(@data, INTERVAL 1 MONTH);
		insert into lancamento values (null,@id_lancamentopai,@id_centrodecusto,@id_finalidade,@id_formadepagamento,0,0,@valor,@numeroParcelaAtual,@datadoacontecimento,@data,@data,null,@localdadespesa,@descricao,@descricaodetalhada,now(),1,@numeroParcelas);
		SET @numeroParcelaAtual = @numeroParcelaAtual + 1;      
	END WHILE;
END */$$
